import{_ as e,z as r,m as a,ap as t}from"./chunks/framework.DmedEOU1.js";const h=JSON.parse('{"title":"IIROSE 适配器配置指南","description":"","frontmatter":{},"headers":[],"relativePath":"markdown/start/config.md","filePath":"markdown/start/config.md","lastUpdated":1759484384000}'),s={name:"markdown/start/config.md"};function n(d,o,l,c,i,g){return a(),r("div",null,[...o[0]||(o[0]=[t('<h1 id="iirose-适配器配置指南" tabindex="-1">IIROSE 适配器配置指南 <a class="header-anchor" href="#iirose-适配器配置指南" aria-label="Permalink to &quot;IIROSE 适配器配置指南&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p><strong>对机器人用户名、密码的更改</strong></p><p><strong>这可能会导致丢失与机器人的连接。</strong></p><p>需要先关闭插件，更新对应配置，再启动插件。</p></div><h2 id="基础配置" tabindex="-1">基础配置 <a class="header-anchor" href="#基础配置" aria-label="Permalink to &quot;基础配置&quot;">​</a></h2><h3 id="usename" tabindex="-1">usename <a class="header-anchor" href="#usename" aria-label="Permalink to &quot;usename&quot;">​</a></h3><p><strong>类型</strong>: <code>string</code> (必需)<br><strong>描述</strong>: BOT 账号（用户名）</p><p>在 IIROSE 注册时设置的用户名。</p><blockquote><p>个人资料名称（不包含 <code>[**]</code> 符号）</p></blockquote><h3 id="uid" tabindex="-1">uid <a class="header-anchor" href="#uid" aria-label="Permalink to &quot;uid&quot;">​</a></h3><p><strong>类型</strong>: <code>string</code> (必需)<br><strong>格式</strong>: 13位小写字母和数字组合<br><strong>描述</strong>: BOT 的唯一标识</p><div class="tip custom-block"><p class="custom-block-title">如何获取 UID？</p><ol><li>登录 IIROSE 账号</li><li>点击左侧菜单 → 个人资料</li><li>复制&quot;唯一标识&quot;字段的值（不包含 <code>[@@]</code> 符号）</li></ol></div><h3 id="password" tabindex="-1">password <a class="header-anchor" href="#password" aria-label="Permalink to &quot;password&quot;">​</a></h3><p><strong>类型</strong>: <code>string</code> (必需)<br><strong>描述</strong>: BOT 密码</p><p>在 &quot;pass&quot; 字段输入你的密码</p><h3 id="roomid" tabindex="-1">roomId <a class="header-anchor" href="#roomid" aria-label="Permalink to &quot;roomId&quot;">​</a></h3><p><strong>类型</strong>: <code>string</code> (必需)<br><strong>格式</strong>: 13位小写字母和数字组合<br><strong>描述</strong>: BOT 的初始房间地址</p><div class="tip custom-block"><p class="custom-block-title">如何获取房间 ID？</p><ol><li>进入想要机器人加入的房间</li><li>房间 ID（不带<code>[__]</code>的部分）</li></ol></div><h3 id="roompassword" tabindex="-1">roomPassword <a class="header-anchor" href="#roompassword" aria-label="Permalink to &quot;roomPassword&quot;">​</a></h3><p><strong>类型</strong>: <code>string</code><br><strong>默认值</strong>: <code>&quot;&quot;</code><br><strong>描述</strong>: BOT 的初始房间密码（可选）</p><p>如果房间设置了密码，需要填写此项。</p><h3 id="signature" tabindex="-1">signature <a class="header-anchor" href="#signature" aria-label="Permalink to &quot;signature&quot;">​</a></h3><p><strong>类型</strong>: <code>string</code><br><strong>默认值</strong>: <code>&quot;&quot;</code><br><strong>描述</strong>: BOT 签名</p><p>显示在机器人个人资料中的签名信息。</p><h2 id="进阶配置" tabindex="-1">进阶配置 <a class="header-anchor" href="#进阶配置" aria-label="Permalink to &quot;进阶配置&quot;">​</a></h2><h3 id="color" tabindex="-1">color <a class="header-anchor" href="#color" aria-label="Permalink to &quot;color&quot;">​</a></h3><p><strong>类型</strong>: <code>string</code><br><strong>默认值</strong>: <code>&quot;rgba(102, 204, 255, 1)&quot;</code><br><strong>格式</strong>: 颜色值（支持 hex、rgba 等格式）<br><strong>描述</strong>: BOT 气泡颜色</p><p>机器人发言时的气泡背景色。</p><h3 id="hangupmode" tabindex="-1">hangUpMode <a class="header-anchor" href="#hangupmode" aria-label="Permalink to &quot;hangUpMode&quot;">​</a></h3><p><strong>类型</strong>: <code>boolean</code><br><strong>默认值</strong>: <code>false</code><br><strong>描述</strong>: 是否开启挂机模式</p><p>开启后机器人将以挂机状态运行。</p><h2 id="连接配置" tabindex="-1">连接配置 <a class="header-anchor" href="#连接配置" aria-label="Permalink to &quot;连接配置&quot;">​</a></h2><h3 id="timeout" tabindex="-1">timeout <a class="header-anchor" href="#timeout" aria-label="Permalink to &quot;timeout&quot;">​</a></h3><p><strong>类型</strong>: <code>number</code><br><strong>默认值</strong>: <code>500</code><br><strong>范围</strong>: <code>100</code> - <code>5000</code><br><strong>单位</strong>: 毫秒<br><strong>描述</strong>: 连接超时时间</p><p>BOT 多久后连接超时。</p><h3 id="keepaliveenable" tabindex="-1">keepAliveEnable <a class="header-anchor" href="#keepaliveenable" aria-label="Permalink to &quot;keepAliveEnable&quot;">​</a></h3><p><strong>类型</strong>: <code>boolean</code><br><strong>默认值</strong>: <code>true</code><br><strong>描述</strong>: 是否开启心跳包</p><p>启用后会定期发送心跳包保持连接活跃状态。</p><h3 id="maxretries" tabindex="-1">maxRetries <a class="header-anchor" href="#maxretries" aria-label="Permalink to &quot;maxRetries&quot;">​</a></h3><p><strong>类型</strong>: <code>number</code><br><strong>默认值</strong>: <code>10</code><br><strong>范围</strong>: <code>1</code> - <code>100</code><br><strong>描述</strong>: 连接失败时的最大重试次数</p><p>达到最大重试次数后不再重试。</p><h2 id="开发者选项" tabindex="-1">开发者选项 <a class="header-anchor" href="#开发者选项" aria-label="Permalink to &quot;开发者选项&quot;">​</a></h2><h3 id="debugmode" tabindex="-1">debugMode <a class="header-anchor" href="#debugmode" aria-label="Permalink to &quot;debugMode&quot;">​</a></h3><p><strong>类型</strong>: <code>boolean</code><br><strong>默认值</strong>: <code>false</code><br><strong>描述</strong>: 是否开启调试模式</p><div class="warning custom-block"><p class="custom-block-title">调试模式警告</p><p>开启调试模式可能导致日志刷屏，开发者不对此负责。仅建议开发者使用。</p></div><h3 id="fulldebugmode" tabindex="-1">fullDebugMode <a class="header-anchor" href="#fulldebugmode" aria-label="Permalink to &quot;fullDebugMode&quot;">​</a></h3><p><strong>类型</strong>: <code>boolean</code><br><strong>默认值</strong>: <code>false</code><br><strong>描述</strong>: 是否开启详细调试模式</p><div class="danger custom-block"><p class="custom-block-title">DANGER</p><p>详细调试模式会输出大量的调试信息，请慎重开启。</p><p>仅限开发者在进行问题排查时使用。</p></div><h3 id="deletemessagedelay" tabindex="-1">deleteMessageDelay <a class="header-anchor" href="#deletemessagedelay" aria-label="Permalink to &quot;deleteMessageDelay&quot;">​</a></h3><p><strong>类型</strong>: <code>number</code><br><strong>默认值</strong>: <code>1500</code><br><strong>范围</strong>: <code>0</code> - <code>10000</code><br><strong>单位</strong>: 毫秒<br><strong>描述</strong>: 撤回消息前的延迟时间</p><p>不建议低于1000毫秒，太快的撤回可能会导致操作失败。</p><h3 id="oldroomid" tabindex="-1">oldRoomId <a class="header-anchor" href="#oldroomid" aria-label="Permalink to &quot;oldRoomId&quot;">​</a></h3><p><strong>类型</strong>: <code>string</code><br><strong>默认值</strong>: <code>&quot;&quot;</code><br><strong>描述</strong>: 内部使用字段</p><p>一般情况下不需要填写，仅供内部使用。</p>',52)])])}const p=e(s,[["render",n]]);export{h as __pageData,p as default};
